import React, { Component } from "react";
import {
  Card,
  CardImg,
  CardImgOverlay,
  CardText,
  CardBody,
  CardTitle
} from "reactstrap";
import Dishdetail from "./DishdetailComponent";

class Menu extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <Dishdetail />
        </div>
      </div>
    );
  }
}

export default Menu;
